package ra.databinding.model.entity;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import javax.persistence.*;import java.util.Date;@NoArgsConstructor@AllArgsConstructor@Getter@Setter@Entitypublic class History {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Integer id;    private Date ngayMua;    @Enumerated(EnumType.STRING)    private StatusOrder statusOrder;}